description:
This is Captain Gallant, soldier of fortues, leader of the foreign legion at Fort Yusan-Bah. He speaks seldom and only when he has something to say. He shoots fast and deadly, but only to protect and defend. The desert knows him as a true friend and a fierce enemy.

